import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import Footer from '../Footer';

function SignUp() {
  return (
    <>
    <h1 className='sign-up'>Sign Up</h1>;
      <Cards />
      <Footer />
    </>
  );
}

export default SignUp;
